import React from 'react';
import './Arrow.css';
import { HiArrowLeft } from 'react-icons/hi';
import Media from 'react-media';
import { useNavigate } from 'react-router-dom';
import { TweenMax } from 'gsap';


// REturn Arrow component 
export default function REturnArroW() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='wrp-arrow-Success'>
   <Arrow />
  </div>
 )
}
export const ScreenSmall = () => (
 <div className='wrp-arrow-Success-sm'>
  <Arrow />
 </div>
);
export const Arrow = () => {
 const navigation = useNavigate();
 navigation(-1);

 React.useEffect(() => {

  TweenMax.from('.wrp-icon', 1.2, { delay: 0.5, opacity: 0, x: -20, ease: Expo.easeIn })
 }, []);

 return (
  <div onClick={() => navigation(-1)} className='wrp-icon'>
   <HiArrowLeft size={'1.8em'} />
  </div>
 );
};
